import React, { useState } from "react";
import "../styles/CadastroImovel.css";

const CadastroImovel = () => {
  const [showMessage, setShowMessage] = useState(false);

  const handleCadastrar = (event) => {
    event.preventDefault(); // Evita o reload da página
    setShowMessage(true);
    setTimeout(() => {
      setShowMessage(false);
    }, 3000); // Esconde a mensagem após 3 segundos
  };

  return (
    <div className="cadastro-imovel">
      <header className="header">
        <h1>Cadastro de Imóveis</h1>
      </header>
      <form onSubmit={handleCadastrar}>
        {/* Dados do Imóvel */}
        <section className="section">
          <h3>Dados do Imóvel</h3>
          <div className="form-group">
            <input type="text" placeholder="Tipo do Imóvel" required />
            <input type="text" placeholder="Área do Imóvel (Ex.: 200m²)" required />
            <input type="number" placeholder="Quantidade de Cômodos" required />
          </div>
          <div className="form-group">
            <input type="text" placeholder="País" required />
            <input type="text" placeholder="Estado" required />
            <input type="text" placeholder="Cidade" required />
          </div>
        </section>

        {/* Dados do Proprietário */}
        <section className="section">
          <h3>Proprietário</h3>
          <div className="form-group">
            <input type="text" placeholder="Nome" required />
            <input type="email" placeholder="Email" required />
            <input type="text" placeholder="Contato" required />
          </div>
          <div className="form-group">
            <input type="text" placeholder="País" required />
            <input type="text" placeholder="Estado" required />
            <input type="text" placeholder="Cidade" required />
          </div>
        </section>

        {/* Dados do Corretor */}
        <section className="section">
          <h3>Corretor</h3>
          <div className="form-group">
            <input type="text" placeholder="Nome" />
            <input type="email" placeholder="Email" />
            <input type="text" placeholder="Contato" />
          </div>
          <div className="form-group">
            <input type="text" placeholder="País" />
            <input type="text" placeholder="Estado" />
            <input type="text" placeholder="Cidade" />
          </div>
        </section>

        {/* Botão de Cadastro */}
        <div className="action">
          <button className="btn-primary" type="submit">
            Cadastrar Imóvel
          </button>
        </div>
      </form>

      {/* Mensagem de Confirmação */}
      {showMessage && (
        <div className="confirmation-message">
          Imóvel cadastrado com sucesso!
        </div>
      )}
    </div>
  );
};

export default CadastroImovel;
